import { Box, TextField, makeStyles, Button, Typography} from '@material-ui/core'
import { Link } from 'react-router-dom'
import { useForm } from "react-hook-form";

const useStyles = makeStyles((theme) =>({
    box:{
        textAlign: 'center',
        marginTop:'-140px',
        display:'flex',
        flexDirection: 'column',
        background:'white',
        borderRadius: '10px',
        border:'5px solid #fafafa',
        [theme.breakpoints.down('sm')]: {
            width: '60%',
        },
    },
    title:{
        marginBottom:'20px'
    },
    input:{
        marginBottom: '10px',
    },
    text:{

    },
    error: {
        textAlign: 'left',
        color: 'red',
        marginBottom: '10px',
    },
}));

interface IForm {

}

const Login = () => {

    const classes = useStyles();

    const { register, handleSubmit, setError, formState: { errors } } = useForm();

    const onSubmit = (data: IForm) => {
        console.log(data);
    }

    return (
        <Box component="form" onSubmit={handleSubmit(onSubmit)} className={classes.box} p={5} width="25%">

            <Typography className={classes.title} variant="h4">Login</Typography>

            <TextField error={errors.email && true} {...register('email',{required:"Email is required!"})} id="outlined-basic" label="Email" variant="outlined" className={classes.input}/>
            <Typography component="span" variant="caption" className={classes.error}>
                {errors.email?.type === 'required' && errors.email.message}
            </Typography>


            <TextField {...register('password',{required:"Password is required!"})} error={errors.email && true} id="outlined-basic" label="Password" variant="outlined" className={classes.input}/>
            <Typography component="span" variant="caption" className={classes.error}>
                {errors.password?.type === 'required' && errors.password.message}
            </Typography>

            <Button type="submit" className={classes.input} variant="contained" size="large" color="primary" style={{marginTop:'20px'}}>Submit</Button>

            <Typography component="span" variant="body2" className={classes.text}>No Account   <Link to="/register">Register</Link> </Typography>

        </Box>
    )
}

export default Login
